import React from 'react';

function Clicker(props)	
	{
	
	return(
		<div>
		<button
			style={{backgroundColor:props.name, color:"#ffffff"}} 
			name={props.name} 
			onClick={props.handleClicker}
			value={props.value} > 
				{props.name} {props.value}
	
		</button>
		</div>


		)
}

export default Clicker;
